これ1つで3つの効果！！<br>「キズ消し」「鏡面仕上げ」「ワックス」「コンパウンドWAX」<br><br>最終仕上げレベルの研磨力！<br>下地処理も同時に完了！<br>●マイクロセラミックパウダーが水アカ・キズを除去！<br>●アクリル系ポリマー配合でボディをガード！<br>●従来のコンパウンドと比較し、作業性が良好！<br><br>■適応ボディカラー<br>ブラック/ブラウン/ブルー/グリーン/グレー/レッド<br>*上記以外の濃色系の車にも使えます。<br><br><br>【名称】自動車用つや出しねりワックス<br>【用途・塗装塗色】塗装の保護及びつや出し<br>黒、赤、青、緑等、濃色のパール、マイカ、メタリック及びソリッド塗装<br>【成分・含有量】アクリル系ポリマー、合成ろう、石油系溶剤（約40%）研磨剤<br>【形式・内容量】ねり・180g<br><br>メーカー名：リンレイ<br>品番：A-95<style type="text/css">
