車のボディ塗装面のスリ傷や水アカ、ピッチタールの除去、ペイント補修後の艶出し研磨に！<br>バイク・自転車・キャンプ・登山・ゴルフ・スキー用品のアルミ、金属部のお手入れに！<br><br><br>【特徴】<br>キズ取り用の粗目、ツヤ出し用の細目、鏡面仕上げ用の極細の3タイプがセットになった、少量サイズの研磨剤です。<br><br><br>【用途】<br>粗目：塗装前のサビ落とし、下地処理。<br>細目：塗装面のツヤ出し、スリ傷の研磨。<br>極細：塗装面のツヤ出し、鏡面仕上げ。<br><br><br>【性能】<br>●粗目<br>平均粒径サイズ：50ミクロン<br>色調：ベージュ<br><br>●細目<br>平均粒径サイズ：2ミクロン<br>色調：ホワイト<br><br>●極細<br>平均粒径サイズ：1ミクロン<br>色調：ライトブラウン<br><br><br>成分：研磨剤、石油系溶剤、界面活性剤<br><br><br>【セット内容】<br>ラビングコンパウンド（粗目） 25g<br>ラビングコンパウンド（細目） 25g<br>ミクロコンパウンド（極細） 25g<br><br><br>メーカー：Holts/ホルツ 武蔵ホルト<br>品番：MH926<style type="text/css">
